import React, {useState} from "react";
import {GoogleMap, Marker, withGoogleMap, withScriptjs} from "react-google-maps";
import {useDispatch, useSelector} from "react-redux";
import {getRouteStations} from "../redux/apiMobileV2/ApiMobileV2Action";
import {Card, Col, Container, FormControl, InputGroup, Row} from "react-bootstrap";
import SkeletonBusCards from "../components/MyComponets/SkeletonBusCards";
import OOPError from "../components/MyComponets/OOPError";

export default function Maps() {
    const dispatch = useDispatch();
    const [routeId, setRouteId] = useState(550);
    const [search, setSearch] = useState('');
    React.useEffect(() => {
        dispatch(getRouteStations(routeId));
    }, []);
    const data = useSelector(state => state.apiMobileV2Reducer.routeStationsData);
    const stations = data ? data.kpp1 : 0;

    const CustomSkinMap = withScriptjs(withGoogleMap(() => (
            <GoogleMap
                defaultZoom={13}
                defaultCenter={{lat: 41.320052, lng: 69.253966}}
                defaultOptions={{
                    scrollwheel: false,
                    zoomControl: true,
                }}
            >
                {stations ? stations.map((item, index) =>
                    stations ? <Marker key={index++} visible={true} defaultTitle={"Station"} cursor={stations[index].sn}
                                       title={stations[index].sn}
                                       position={{lat: stations[index].lat, lng: stations[index].lng}}/> : ''
                ) : ''}

            </GoogleMap>
        ))
    );

    return (
        <>
            <Row>
                <Col>
                    <InputGroup className="mb-3">
                        <InputGroup.Prepend>
                            <InputGroup.Text>Search</InputGroup.Text>
                        </InputGroup.Prepend>
                        <FormControl onChange={e => {
                            setSearch(e.target.value)
                        }}/>
                        <InputGroup.Prepend>
                            <InputGroup.Text><i className="nc-icon nc-zoom-split mr-1"/></InputGroup.Text>
                        </InputGroup.Prepend>
                    </InputGroup>
                </Col>
            </Row>
            <Row>
                {status !== "WARNING" ? data && data.length > 0 ? data.filter((item) => {
                    if (search === "") {
                        return item;
                    } else if (item.name.toLowerCase().includes(search.toLowerCase())) {
                        return item;
                    }
                }).map((item, index) =>
                    <Col lg="2" sm="6" key={index++}>
                        <Card className="card-stats">
                            <Card.Body>
                                <Row>
                                    <Col xs="5">
                                        <div className="icon-big text-center icon-warning">
                                            <i className="nc-icon nc-bus-front-12 text-primary"/>
                                        </div>
                                    </Col>
                                    <Col xs="7">
                                        <div className="numbers">
                                            <p className="card-category">id:{item.route_id}</p>
                                            <Card.Title as="h4">{item.name}</Card.Title>
                                        </div>
                                    </Col>
                                </Row>
                            </Card.Body>
                            <Card.Footer>
                                <hr/>
                                <div>
                                    <i className="nc-icon nc-refresh-02 text-danger mr-1"/>
                                    {"  "}{item.kpp1.length > 10 ? item.kpp1.slice(0, 10) + "..." : item.kpp1}
                                </div>
                                <br/>
                                <div>
                                    <i className="nc-icon nc-refresh-02 text-success mr-1"/>
                                    {"  "}{item.kpp2.length > 10 ? item.kpp2.slice(0, 10) + "..." : item.kpp2}
                                </div>
                            </Card.Footer>
                        </Card>
                    </Col>
                ) : <SkeletonBusCards/> : <OOPError/>}
            </Row>
            <CustomSkinMap
                googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyDS4sGjQ5hi3IFNYa0dYGyuxmNZzPwv1jc"
                loadingElement={<div style={{height: `100%`}}/>}
                containerElement={<div style={{height: `80vh`}}/>}
                mapElement={<div style={{height: `100%`}}/>}
            />
        </>
    );
};
